let arr = '';
arr = arr.split('');
// console.log(arr.join(''));

while(true){
    var count =0;
    for(let i =0 ; i < arr.length-1 ; i++){
        if((arr[i] == arr[i+1].toLowerCase() && arr[i].toUpperCase() == arr[i+1]) ||
        (arr[i] == arr[i+1].toUpperCase() && arr[i].toLowerCase() == arr[i+1])
        ){        
            for(let k = i ; k < arr.length-2 ; k++){
                arr[k] = arr[k+2];
            }
            for(let k=1; k<=2 ; k++){
                arr.pop();
            }
            count++;
        }
    }
    if(count == 0){
        break;
    }
}
